import navbar from './Nav.module.css';
import {NavLink} from 'react-router-dom';
const Nav = (props) => {

    return (
        <nav className={navbar.sidebar}>
            <div> <NavLink to="/profile">Profile</NavLink> </div>
            <div> <NavLink to="/dialogs">Dialogs</NavLink> </div>
            <div> <NavLink to="/">Music</NavLink> </div>
            <div> <NavLink to="/">Post</NavLink> </div>
            <div> <NavLink className={navbar.sidebar_setting} to="#" >Setting</NavLink> </div>
            <div className={navbar.friend_list}>
                <NavLink to={'/'}>Friends</NavLink>
                <div className={navbar.friend_item}><span className={navbar.friend_item_name}>{props.username}</span></div>
            </div>
        </nav>
    );
}

export default Nav;
